export default function Header({shown, setShown}) {
    return (
        <header className="header-block">
            <div className="header-block-left-part">
                <img
                    src="/images/favicon.jpeg"
                    alt="Логотип"
                />
                <h1>Склад заготовок и комплектующих</h1>
            </div>
            <div className="header-block-right-part">
                {!shown && (
                    <div className="header-block-right-part-menu">
                        <button className="filed-button" onClick={() => {setShown(true); window.scrollTo(0,0);}}>Добавить заказчика</button>
                    </div>
                )}
            </div>
        </header>
    );
}
